import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import Login from './Pages/Login';

function App() {
  return (
    <div className="App">
      <Router>
          <Routes>
            <Route exact path='/' component={Login} />,
            <Route exact path='/login' component={Login} />,
          </Routes>

          <Home></Home>
      </Router>
    </div>
  );
}

function Home({ match }) {
  return <h2>여기는 홈페이지입니다.</h2>
}

export default App;
